  return (
    <>
      <Head>
        <title></title>
      </Head>
      <AppLayout>
        <Link href="/about">
          <a>about</a>
        </Link>
        <div>hello,next!</div>
        {/* AppLayout내에 태그내에 있는 내용 전체를 {children} 으로 받을 수 있는 것 */}
      </AppLayout>
    </>
  );
};
export default Home;
